dodajPinezke("Opuszczone Polska", [52.1711944444444, 20.9847333333333], "Fort VII \"Zbar≈º\"", "Fort VII \"Zbar≈º\". Jednowa≈Çowy, otoczony fosƒÖ fort zbudowano na planie piƒôcioboku. W ramach likwidacji twierdzy po 1909 roku fort zosta≈Ç czƒô≈õciowo rozebrany. W czasie jednej z modernizacji wzniesiono jednƒÖ z niewielu w Warszawie betonowƒÖ kaponierƒô przeciwskarpowƒÖ, kt√≥rej potƒô≈ºne ruiny istniejƒÖ do dzi≈õ. Zachowa≈Çy siƒô tak≈ºe koszary szyjowe. Budynki wojskowe istnia≈Çy na tym terenie do 1999 roku. W okresie p√≥≈∫niejszym nastƒÖpi≈Ço zalanie terenu fortu, co doprowadzi≈Ço ceglane koszary do ruiny.<br><br><br>Opis dojazdu	Obiekt znajduje siƒô na wsch√≥d od ul. J. Gordona Bennetta.");
